        case 1:
            return(
                <>
                    <MealPage />
                </>
            );
        case 2:
            return(
                <>
                    <MealPage />
                </>
            );
        default:
            return(
                <div>
                    오류발생
                </div>
            );
    }
}

export default MainPage;
